import React from "react";

const PostFilter = () => {
    return (
        <div>
            <MyInput
                value={searchQuery}
                onChange={e => SetSearchQuery(e.target.value)}
                placeholder="Поиск..."
            />
            <MySelect
                defaultValue='Сортировка'
                value={selectedSort}
                onChange={sortPosts}
                options={
                    [{
                        value: 'title',
                        name: 'По значению'
                    },
                    {
                        value: 'description',
                        name: 'По описанию'
                    }]
                }
            />
        </div>
    )
};

export default PostFilter
